import * as React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './components/Login';
import LoginReset from './components/LoginReset';
import LoginBlocked from './components/LoginBlocked';
import Setting from './components/Setting';
import SettingsSite from './components/SettingsSite';
import SettingsModule from './components/SettingsModule';
import SettingsPeople from './components/SettingsPeople';
import SettingsTowerCrane from './components/SettingsTowerCrane';

function App() {
  return (
    <>
      <Router>
        <Routes>
          {/* Authentication */}
          <Route exact path='/' element={<Login/>}/>
          <Route exact path='/reset' element={<LoginReset/>}/>
          <Route exact path='/login_blocked' element={<LoginBlocked/>}/>
          {/* Settings - System */}
          <Route exact path='/settings' element={<Settings/>}/> 
          <Route exact path='/settings-site' element={<SettingsSite/>}/>  
          <Route exact path='/settings-module' element={<SettingsModule/>}/>  
          {/* Settings - People & Co. */}
          <Route exact path='/settings-people' element={<SettingsPeople/>}/> 
          {/* Settings - Assets */}
          <Route exact path='/settings-towercrane' element={<SettingsTowerCrane/>}/>  
        </Routes>
      </Router>
    </>
  );
}

export default App;
